INSERT INTO `vote_mdls` (`id`, `meeting_id`, `item_number`, `resoluton_number`, `proposed_plan`, `vote`, `status`, `from`, `to`, `user_types`, `rem_addr`, `created_at`, `updated_at`) VALUES
(69, '1', 'ITEM NO. - 1', '1', '1', '<p>“RESOLVED THAT AAA Insolvency Professionals LLP, a registered Insolvency Professional (Registration No. IBBI/IPE-0002/IPA-1/2022-23/50001) be and is hereby appointed as the Resolution Professional by replacing Interim Resolution Professional, Mr. Ganga Ram Agarwal, in the matter of Presidium Educational Institution Private Limited in accordance with provisions of section 22(3)(b) of the IBC, 2016. AAA Insolvency Professionals LLP authorizes its Designated Partner Mr. Anil Goel in relation to this case to sign and act on its behalf for the conduct of the CIRP. Mr. Amandeep Bajaj, the Authorised Representative of J.C. Flowers Asset Reconstruction Private Limited be and is hereby authorized to file an application for appointing AAA Insolvency Professionals LLP as the Resolution Professional in the matter of Presidium Educational Institution Private Limited before the adjudicating authority, in accordance with the provisions of Section 22(3)(b) of the Insolvency and Bankruptcy Code, 2016.</p>', '1', '2023-01-31 16:15', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:43:53', '2023-01-31 10:43:53'),
(70, '1', 'ITEM NO. 2', '1', '', '<p>RESOLVED THAT the cumulative fee of Rs. 2,00,000/- (Rupees two lakhs only) per month plus applicable taxes be and is hereby approved for the Interim Resolution Professional i.e. Mr. Ganga Ram Agarwal and AAA Insolvency Professionals LLP, the IPE providing support service to IRP for the entire period during which the IRP would continue to manage the operations of the Presidium Educational Institution Private Limited under Section 23 of the Code as the Resolution Professional till such time the appointment of the proposed Resolution Professional is confirmed by the order of Hon’ble NCLT.<br></p>', '1', '2023-01-31 16:15', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:44:47', '2023-01-31 10:44:47'),
(71, '1', 'ITEM NO. 3', '1', '', '<p class=\"gmail-MsoBodyText\" style=\"color: rgb(34, 34, 34); text-align: justify; line-height: 24px; font-size: 12pt; font-family: &quot;Times New Roman&quot;, serif;\"><span style=\"font-size: 11pt; line-height: 22px; font-family: &quot;Bookman Old Style&quot;, serif;\">“<b>RESOLVED THAT&nbsp;</b>a consolidated fee of Rs. 2,00,000/- (Rupees two lakhs only) per month plus applicable taxes be and is hereby approved as remuneration of the Resolution Professional i.e., AAA Insolvency Professionals LLP for the entire period during which it continues to manage the operations of the Corporate Debtor, as the Resolution Professional”</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">“<b>FURTHER RESOLVED THAT</b>&nbsp;following incentives would be payable to the Resolution Professional: -</span></p><p class=\"gmail-MsoListParagraph\" style=\"color: rgb(34, 34, 34); text-indent: 0in; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><b><span style=\"font-family: &quot;Times New Roman&quot;, serif;\">a)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></b><b><u><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Performance-linked incentive fee for timely resolution.</span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">In cases where resolution plan is submitted to the Adjudicating Authority within the time period given in table-2 from the insolvency commencement date, performance-linked incentive fee as per table-2 will be paid to the resolution professional, after approval of such resolution plan by the Adjudicating Authority on commencement of payment to creditors and restart of construction by the resolution applicant.</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><b><u><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Table-2: Performance-linked incentive fee for timely resolution</span></u></b></p><table class=\"gmail-MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"588\" style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small; width: 440.75pt; margin-left: 0.5in; border: none;\"><tbody><tr><td width=\"288\" valign=\"top\" style=\"margin: 0px; width: 215.75pt; border: 1pt solid windowtext; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin: 0in 2.45pt 10pt 0in; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Time period from insolvency commencement date</span></p></td><td width=\"300\" valign=\"top\" style=\"margin: 0px; width: 225pt; border-top: 1pt solid windowtext; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-image: initial; border-left: none; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Fee as % of Realizable Value</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">&nbsp;</span></p></td></tr><tr><td width=\"288\" valign=\"top\" style=\"margin: 0px; width: 215.75pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">(i) Less than or equal to 165 days</span></p></td><td width=\"300\" valign=\"top\" style=\"margin: 0px; width: 225pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">1.00</span></p></td></tr><tr><td width=\"288\" valign=\"top\" style=\"margin: 0px; width: 215.75pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin: 0in 2.45pt 10pt 0in; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">(ii) More than 165 days but less than or equal to 270 days</span></p></td><td width=\"300\" valign=\"top\" style=\"margin: 0px; width: 225pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">0.75</span></p></td></tr><tr><td width=\"288\" valign=\"top\" style=\"margin: 0px; width: 215.75pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin: 0in 2.45pt 10pt 0in; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">(iii) More than 270 days but less than or equal to 330 days</span></p></td><td width=\"300\" valign=\"top\" style=\"margin: 0px; width: 225pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">0.50</span></p></td></tr><tr><td width=\"288\" valign=\"top\" style=\"margin: 0px; width: 215.75pt; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: 1pt solid windowtext; border-image: initial; border-top: none; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">(iv) More than 330 days</span></p></td><td width=\"300\" valign=\"top\" style=\"margin: 0px; width: 225pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0in 5.4pt;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0px; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">0.00</span></p></td></tr></tbody></table><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">&nbsp;</span></p><p class=\"gmail-MsoListParagraph\" style=\"color: rgb(34, 34, 34); text-indent: 0in; text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><b><span style=\"font-family: &quot;Times New Roman&quot;, serif;\">b)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></b><b><u><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Performance-linked incentive fee for value maximisation.</span></u></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">The performance-linked incentive fee for value maximization may be paid to the resolution professional at the rate of one per cent of the amount by which the realizable value is higher than the liquidation value, after approval of the resolution plan by Adjudicating Authority on commencement of payment to creditors by the resolution applicant</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0px; color: rgb(34, 34, 34); text-align: justify; line-height: 22px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-family: &quot;Bookman Old Style&quot;, serif;\">Explanation: For the purposes of clause 3 and clause 4, “realizable value” means the amount payable to creditors in the resolution plan approved under section 31”</span></p>', '1', '2023-01-31 16:22', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:51:11', '2023-01-31 10:59:56'),
(72, '1', 'ITEM NO. 4', '1', '', '<p>RESOLVED THAT, the Form‐G as placed at Enclosure – E be and is hereby approved by the members of the Committee of Creditors for the publication for inviting expression of interest in accordance with Regulation 36A of the Insolvency and Bankruptcy Board of India (Insolvency Resolution Process for Corporate Persons) Regulations, 2016. The minimum eligibility criteria along with the Earnest Money Deposit to be made by the Prospective Resolution Applicant as placed at Enclosure– F be and is hereby approved by the members of the Committee of Creditors.<br></p>', '1', '2023-01-31 16:22', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:52:22', '2023-01-31 10:52:22'),
(73, '1', 'ITEM NO. 5', '1', '', '<p>RESOLVED THAT the fee chart of Legal Counsel, M/s India Juris, as attached and marked as Enclosure-C be and is hereby approved by the members of the Committee of Creditors in the matter of Presidium Educational Institution Private Limited. The cost of M/s India Juris shall form the part of Corporate Insolvency Resolution Process Cost (CIRP) Cost in the matter of Presidium Educational Institution Private Limited.<br></p>', '1', '2023-01-31 16:24', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:53:23', '2023-01-31 10:53:23'),
(74, '1', 'ITEM NO. 6', '1', '', '<p>RESOLVED THAT the fee chart of M/s Varma Anil and Associates, Chartered Accountants, as attached and marked as Enclosure-D, be and is hereby approved by the members of the Committee of Creditors in the matter of Presidium Educational Institution Private Limited. The cost of M/s Varma Anil and Associates, Chartered Accountants, shall form the part of Corporate Insolvency Resolution Process Cost (CIRP) Cost in the matter of Presidium Educational Institution Private Limited.<br></p>', '1', '2023-01-31 16:24', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:54:06', '2023-01-31 10:54:06'),
(75, '1', 'ITEM NO. 7', '1', '', '<p>RESOLVED THAT the appointment of the registered valuers for each set of valuer and their professional fees (as mentioned in the table A of the facts and explanatory of this resolution) for conducting the valuation of the assets of Presidium Educational Institution Private Limited be and is hereby approved by the members of the committee of creditors. The Resolution Professional be and is hereby authorized to appoint two registered valuers/registered valuers entity (for all three class of assets) at the professional fees given Table A of the facts and explanatory of this resolution.<br></p>', '1', '2023-01-31 16:25', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:55:00', '2023-01-31 10:55:00'),
(76, '1', 'ITEM NO. 8', '1', '', '<p>RESOLVED THAT the IRP/RP, as the case may be, in the matter of Presidium Educational Institution Private Limited be and is hereby authorized to delegate its authority to any person, to exercise his powers under the Code or as derived from Committee of Creditors for the purpose of carrying on corporate insolvency resolution process including business operations, for taking custody and control of assets of the corporate debtor including business records; for representing the corporate debtor with third parties; for representing before various courts/tribunals, etc. which are required for the smooth functioning of corporate insolvency resolution process. The IRP/RP, as the case may be, in the matter of Presidium Educational Institution Private Limited would be responsible for regular monitoring of such persons authorized by him who use his authority. The IRP/RP, as the case may be, in the matter of Presidium Educational Institution Private Limited would be responsible personally for all acts done by such persons as authorized by him.<br></p>', '1', '2023-01-31 16:26', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:55:53', '2023-01-31 10:55:53'),
(77, '1', 'ITEM NO. 9', '1', '', '<p>RESOLVED THAT in pursuant to the provisions of Regulation 19 of Insolvency and Bankruptcy Board of India (Insolvency Resolution Process for Corporate Persons) Regulation, 2016, the proposal for reducing the time limit of sending the Notice of the COC meeting from 5 days to 48 hours by the Interim Resolution Professional or Resolution professional, as the case may be, as placed before the members of Committee, be and is hereby approved.<br></p>', '1', '2023-01-31 16:27', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:56:35', '2023-01-31 10:56:35'),
(78, '1', 'ITEM NO. 10', '1', '', '<p>RESOLVED THAT the Resolution Professional be and is hereby authorized by the members of the COC to open a new bank account in the name of the Corporate Debtor M/s Presidium Educational Institution Private Limited for the purpose of usage during the Corporate Insolvency Resolution Process and the account would be operated by either Interim Resolution Professional or resolution professional or the authorized partner of the IPE.<br></p>', '1', '2023-01-31 16:28', '2023-02-01 11:00', 'Secured', '122.161.50.134', '2023-01-31 10:57:22', '2023-01-31 11:27:20');
